import * as types from './actionTypes';

function url() {
  return 'localhost:4000/partidos';
}

export function receiveParties(json) {
  return {type: types.RECEIVE_PARTIES, parties: json.parties};
}

export function fetchStuff() {
  return dispatch => {
    return fetch(url(), {
      method: 'GET',
      mode: 'cors',
      credentials: 'include',
      headers: {
        'x-api-key': apiKey,
        'Accept': 'application/json'
      }
    })
    .then(response => response.json())
    .then(json => dispatch(receiveParties(json)));
  };
}
